import React from 'react';
import Item from '../Item';


export default function List(props) {
    const { lists, deleteList, completeList, startEditList, finishEditListtodos } = props;
    return (
        <div style={{ display: 'block' }} className="main">
            {todos.map(todo => <Item key={todo.id} {...todo} deleteList={deleteList} completeList={completeList} editList={editList} makeNewTodo={makeNewTodo} />)}
        </div>
    );
}
